<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta content="width=device-width, initial-scale=1.0" name="viewport"/>
    <title>Terapeuta Ilustrada</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@400;600;700;900&family=Pacifico&display=swap" rel="stylesheet"/>
    <style>
        .hero-bg {
            background-image: url('image-hero-background.jpg');
            background-size: cover;
            background-position: center;
        }
        .animate-bounce-slow {
            animation: bounce 2s infinite;
        }
        .animate-float {
            animation: float 4s ease-in-out infinite;
        }
        @keyframes bounce {
            0%, 100% { transform: translateY(-25%); }
            50% { transform: translateY(0); }
        }
        @keyframes float {
            0% { transform: translateY(0px); }
            50% { transform: translateY(-15px); }
            100% { transform: translateY(0px); }
        }
        .gradient-text {
            background: linear-gradient(45deg, #ff9a9e 0%, #fad0c4 99%, #fad0c4 100%);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
        }
        .card-hover-effect:hover img {
            transform: scale(1.05);
        }
        .card-hover-effect:hover .overlay {
            opacity: 1;
        }
    </style>
    <script>
        tailwind.config = {
            darkMode: "class",
            theme: {
                extend: {
                    colors: {
                        primary: '#FF9A8B', // Coral Pastel
                        secondary: '#87CEEB', // Azul Cielo Pastel
                        accent: '#FFDA8B', // Amarillo Pastel
                        'background-light': '#FFF0F5', // Rosa Lavanda
                        'background-dark': '#E6E6FA', // Lavanda
                        'text-light': '#4A4A4A',
                        'text-dark': '#2C3E50',
                    },
                    fontFamily: {
                        display: ['Pacifico', 'cursive'],
                        body: ['Montserrat', 'sans-serif'],
                    },
                    borderRadius: {
                        'DEFAULT': '1rem',
                        'lg': '1.5rem',
                        'xl': '2rem',
                    },
                    boxShadow: {
                        'glow': '0 4px 14px 0 rgba(255, 154, 139, 0.5)',
                    }
                },
            },
        };
    </script>
</head>

<script>
    // Mobile menu toggle
    const mobileMenuButton = document.getElementById('mobile-menu-button');
    const mobileMenu = document.getElementById('mobile-menu');
    mobileMenuButton.addEventListener('click', () => {
        mobileMenu.classList.toggle('hidden');
    });

    // Simple animation for elements on scroll (optional, for more advanced effects)
    document.addEventListener('DOMContentLoaded', (event) => {
        const elements = document.querySelectorAll('.animate-fade-in-up, .animate-fade-in-down, .animate-bounce, .animate-float');
        const observer = new IntersectionObserver((entries) => {
            entries.forEach(entry => {
                if (entry.isIntersecting) {
                    entry.target.classList.add('animate-in'); // Add a class to trigger the animation
                    // For specific animations like fade-in-down, you might need more custom logic
                }
            });
        }, { threshold: 0.1 });

        elements.forEach(el => {
            observer.observe(el);
        });
    });
</script>
